import React from 'react';
import './MapSize.css'; // Ваш CSS для размеров и стилей
import PropertyCard from './PropertyCard';
import { Map2GIS } from './Map2GIS';

// Тестовые данные
export const testProperty = {
    name: "Квартира мечты",
    description: "Просторная квартира с видом на город, свежий ремонт.",
    cntrooms: 3,
    square: 85,
    floor: 5,
    images: [
        "https://images.cdn-cian.ru/images/2653186249-1.jpg",
        "https://images.cdn-cian.ru/images/2653186278-1.jpg"
    ],
    url: "https://example.com/property/1",
    price: 15000000,
    priceForMetr: 176470,
    address: "г. Москва, ул. Примерная, д. 10",
    station: "м. Парк Культуры",
    map: {
        "Продукты": [
            { name: "Пятёрочка", address: "ул. Ленина, 5", coords: [37.618423, 55.751244] },
            { name: "Перекрёсток", address: "ул. Ленина, 10", coords: [37.620000, 55.752000] }
        ],
        "Школы": [
            { name: "Школа №12", address: "ул. Ленина, 12", coords: [37.619000, 55.753000] }
        ],
        "Детские сады": [],
        "Медицина": [
            { name: "Поликлиника №5", address: "ул. Ленина, 20", coords: [37.621000, 55.754000] }
        ],
        "Аптеки": [],
        "Спорт": [],
        "Культура": [],
        "Бары": [
            { name: "Бар Пятница", address: "ул. Ленина, 15", coords: [37.622000, 55.755000] }
        ]
    }
};

function MapSize() {
    return (
        <div className="container" style={{ display: "flex", flexDirection: "column", gap: "20px" }}>
            <div className="text">
                <h1>Привет, мир!</h1>
                <p>Это базовый функциональный компонент на JSX.</p>
            </div>

            <div className="map" style={{ width: "100%", height: "500px" }}>
                <Map2GIS property={testProperty} />
            </div>

            <PropertyCard property={testProperty} />
        </div>
    );
}

export default MapSize;
